import React from "react";
import { 
    GoogleMap, 
    StandaloneSearchBox,
    LoadScript,
    Autocomplete,

 } from '@react-google-maps/api';


 const containerStyle = {
    width: '400px',
    height: '400px'
  };

  const center = {
    lat: -3.745,
    lng: -38.523
  };


class Map extends React.Component{





    render(){





        return(

            <LoadScript
            googleMapsApiKey="AIzaSyDSxGX9tx_1UJo0qX_j9lokygiIWDZqJf0"
          >
            <GoogleMap
              mapContainerStyle={containerStyle}
              center={center}
              zoom={10}
            >
                 <Autocomplete

                    >
                        <input
                        type="text"
                        placeholder="Customized your placeholder"
                        style={{
                            boxSizing: `border-box`,
                            border: `1px solid transparent`,
                            width: `240px`,
                            height: `32px`,
                            padding: `0 12px`,
                            borderRadius: `3px`,
                            boxShadow: `0 2px 6px rgba(0, 0, 0, 0.3)`,
                            fontSize: `14px`,
                            outline: `none`,
                            textOverflow: `ellipses`,
                            position: "absolute",
                            left: "50%",
                            marginLeft: "-120px"
                        }}
                        />
                 </Autocomplete>
              { /* Child components, such as markers, info windows, etc. */ }
              <></>
            </GoogleMap>
          </LoadScript>
        );
    }
}

export default Map;
